import React, { useState } from "react";
import { Link, useLocation, useNavigate } from "react-router-dom";
import { useAuth } from "../contexts/AuthContext";
import { motion } from "framer-motion";
import { Shield, Menu, X } from "lucide-react";

const AuthButtons = () => {
  const { isAuthenticated, user, logout } = useAuth();
  const navigate = useNavigate();
  const [isProfileOpen, setIsProfileOpen] = useState(false);

  const handleLogout = async () => {
    await logout();
    navigate("/");
  };

  const handleDashboardNavigation = () => {
    if (user?.role === 'ADMIN') {
      navigate('/admin-dashboard');
    } else {
      navigate('/dashboard');
    }
  };

  if (isAuthenticated) {
    return (
      <div className="flex items-center gap-3">
        <button
          onClick={handleDashboardNavigation}
          className="px-6 py-2 rounded-lg font-medium transition-all duration-300"
          style={{
            backgroundColor: '#0061FF',
            color: 'white'
          }}
          onMouseEnter={(e) => {
            e.target.style.backgroundColor = '#0052E0';
          }}
          onMouseLeave={(e) => {
            e.target.style.backgroundColor = '#0061FF';
          }}
        >
          Dashboard
        </button>
        <div className="relative">
          <button
            onClick={() => setIsProfileOpen(!isProfileOpen)}
            className="h-10 w-10 rounded-full flex items-center justify-center text-white font-semibold hover:opacity-80 transition"
            style={{backgroundColor: '#0061FF'}}
          >
            {(user?.name || user?.email || 'U').charAt(0).toUpperCase()}
          </button>
          
          {isProfileOpen && (
            <>
              <div className="fixed inset-0 z-10" onClick={() => setIsProfileOpen(false)} />
              <div className="absolute right-0 mt-2 w-64 bg-white rounded-lg shadow-lg border z-20">
                <div className="p-4 border-b">
                  <p className="font-semibold text-gray-800">{user?.name || 'User'}</p>
                  <p className="text-sm text-gray-600">{user?.email}</p>
                  <p className="text-xs text-gray-500 mt-1">Role: {user?.role || 'USER'}</p>
                </div>
                <div className="p-2">
                  <button
                    onClick={() => {
                      handleLogout();
                      setIsProfileOpen(false);
                    }}
                    className="w-full text-left px-3 py-2 text-sm text-red-600 hover:bg-red-50 rounded transition"
                  >
                    Logout
                  </button>
                </div>
              </div>
            </>
          )}
        </div>
      </div>
    );
  }

  return (
    <div className="flex gap-3">
      <Link
        to="/login"
        className="px-6 py-2 text-gray-600 font-medium hover:text-gray-800 transition-colors"
      >
        Login
      </Link>
      <Link
        to="/register"
        className="px-6 py-2 rounded-lg font-medium transition-all duration-300"
        style={{
          backgroundColor: '#0061FF',
          color: 'white'
        }}
        onMouseEnter={(e) => {
          e.target.style.backgroundColor = '#0052E0';
        }}
        onMouseLeave={(e) => {
          e.target.style.backgroundColor = '#0061FF';
        }}
      >
        Get Started
      </Link>
    </div>
  );
};

export default function Navbar() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  return (
    <header className="fixed w-full top-0 z-50 bg-white/95 backdrop-blur-md border-b border-gray-100">
      <nav className="max-w-7xl mx-auto px-6 py-4 flex justify-between items-center">
        <Link to="/" className="flex items-center gap-3 group">
          <motion.div
            whileHover={{ rotate: 360, scale: 1.1 }}
            transition={{ duration: 0.6, ease: "easeInOut" }}
            className="p-2 rounded-xl"
            style={{backgroundColor: '#662222'}}
          >
            <Shield className="w-6 h-6 text-white" />
          </motion.div>
          <span className="text-2xl font-black tracking-tight" style={{color: '#662222', textShadow: '0 1px 2px rgba(0,0,0,0.1)'}}>SecureVault</span>
        </Link>

        <div className="hidden md:flex items-center gap-6">
          <Link to="/" className="flex items-center gap-2 px-3 py-2 rounded-lg transition-all duration-300 hover:scale-105" style={{backgroundColor: '#662222', color: 'white'}} onMouseEnter={(e) => e.target.style.backgroundColor = '#4a1a1a'} onMouseLeave={(e) => e.target.style.backgroundColor = '#662222'}>
            <svg className="w-5 h-5" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 12l2-2m0 0l7-7 7 7M5 10v10a1 1 0 001 1h3m10-11l2 2m-2-2v10a1 1 0 01-1 1h-3m-6 0a1 1 0 001-1v-4a1 1 0 011-1h2a1 1 0 011 1v4a1 1 0 001 1m-6 0h6" />
            </svg>
            Home
          </Link>
          <AuthButtons />
        </div>

        <div className="md:hidden">
          <button onClick={() => setIsMenuOpen(!isMenuOpen)}>
            {isMenuOpen ? <X className="w-7 h-7" /> : <Menu className="w-7 h-7" />}
          </button>
        </div>
      </nav>

      {isMenuOpen && (
        <motion.div
          initial={{ opacity: 0, y: -10 }}
          animate={{ opacity: 1, y: 0 }}
          className="md:hidden absolute top-full left-0 right-0 bg-white shadow-lg p-6 flex flex-col gap-4 border-b border-gray-100"
        >
          <AuthButtons />
        </motion.div>
      )}
    </header>
  );
}
